        #node651_meta [plp-field] {
            padding-bottom: 14px;
            font-size: 14px;
            font-family: Arial;
        }

        #node651_meta .name {
            font-weight: normal;
            font-family: Arial;
            opacity: 0.8;
            margin-bottom: 6.5px;
            font-size: 13px;
            word-wrap: break-word;
            text-transform: uppercase;
            ;
            letter-spacing: 0.1em;
            ;
        }

        #node651_meta .form-control {
            height: auto;
            line-height: 1.2;
            box-shadow: none;
            position: relative;
            background-color: rgb(255, 255, 255);
            color: rgba(0, 0, 0, 0.5);
            border: 1px solid rgba(0, 0, 0, 0.25);
            border-radius: 0px;
            padding: 12px 9.6px;
            font-size: 14px;
            cursor: initial;
        }

        #node651_meta .form-control:focus,
        #node651_meta .form-control:focus-within {
            border-color: rgb(255, 65, 65);
            background-color: rgb(252, 252, 252);
        }

        #node651_meta .form-control+.form-control {
            margin-top: 10px;
        }

        #node651_meta label {
            font-weight: normal;
            display: block;
            cursor: pointer;
        }

        #node651_meta textarea {
            resize: vertical;
        }

        #node651_meta .checkbox {
            width: 22px;
            height: 22px;
            padding: 0;
            margin: 0 5.5px 0 0;
            line-height: 0;
            min-height: auto;
            display: inline-block;
            vertical-align: middle;
            background: white;
            border: 2px solid rgba(0, 0, 0, 0.25);
            position: relative;
            transition: 300ms all;
            border-radius: 2px;
        }

        #node651_meta .checkbox svg {
            width: 100%;
            opacity: 0;
            transform: scale(0);
            transition: 300ms all;
        }

        #node651_meta input:hover~.checkbox,
        #node651_meta input:focus~.checkbox {
            border-color: rgb(255, 160, 160);
        }

        #node651_meta input:checked~.checkbox {
            border-color: rgb(255, 33, 33);
            background-color: rgb(255, 65, 65);
        }

        #node651_meta input:active~.checkbox {
            box-shadow: inset 0 0 5px rgba(0, 0, 0, 0.15);
        }

        #node651_meta input:checked~.checkbox svg {
            opacity: 1;
            transform: scale(1);
        }

        #node651_meta .radio {
            margin: 0;
            margin: 0 5.5px 0 0;
            padding: 0;
            line-height: 0;
            width: 22px;
            height: 22px;
            min-height: auto;
            display: inline-block;
            vertical-align: middle;
            background: white;
            border: 2px solid rgba(0, 0, 0, 0.25);
            position: relative;
            transition: 300ms all;
            border-radius: 100px;
        }

        #node651_meta .radio:before {
            position: absolute;
            left: 0;
            width: 100%;
            top: 0;
            height: 100%;
            content: '';
            display: block;
            background-color: white;
            border-radius: 100px;
            opacity: 0;
            transform: scale(0);
            transition: 300ms all;
        }

        #node651_meta input:hover~.radio,
        #node651_meta input:focus~.radio {
